import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';  // Importar el componente principal

// Renderizar el componente App en el elemento con id 'root' en el HTML
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')  // Este es el div que debe existir en tu HTML
);
ReactDOM.render(<App />, document.getElementById('root'));
